import React from 'react';
import {
  Text,
  ScrollView,
  SafeAreaView,
} from 'react-native';


export default function LoginScreen() {
  return (
    <SafeAreaView>
      <ScrollView>
        <Text>This is Login screen!</Text>
      </ScrollView>
    </SafeAreaView>
  );
}
